import React, { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import FormMoal from './FormMoal';
import "./Formstyle.css"

function ReactModal() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);

  return (
    <>
      <Button variant="" onClick={handleShow}>
      <svg xmlns="http://www.w3.org/2000/svg" width="45" height="45" fill="currentColor" className="bi bi-person-fill-add" viewBox="0 0 16 16">
  <path d="M12.5 16a3.5 3.5 0 1 0 0-7 3.5 3.5 0 0 0 0 7Zm.5-5v1h1a.5.5 0 0 1 0 1h-1v1a.5.5 0 0 1-1 0v-1h-1a.5.5 0 0 1 0-1h1v-1a.5.5 0 0 1 1 0Zm-2-6a3 3 0 1 1-6 0 3 3 0 0 1 6 0Z"/>
  <path d="M2 13c0 1 1 1 1 1h5.256A4.493 4.493 0 0 1 8 12.5a4.49 4.49 0 0 1 1.544-3.393C9.077 9.038 8.564 9 8 9c-5 0-6 3-6 4Z"/>
</svg>
      </Button>
<div >
  

      <Modal show={show} onHide={handleClose}  >
        
        <Modal.Body   className="modelstyle px-5">
            <Modal.Header closeButton>
          <div className="text-size">
               <h3 className='pl-5 ragis'>Registraion</h3>
          </div>
        </Modal.Header>
            <FormMoal ></FormMoal>
            
            
            </Modal.Body>
        
      </Modal></div>
    </>
  );
}

 export default ReactModal;
